fn get_notes_oracle<N, S>(
    _storage_slot: Field,
    _num_selects: u8,
    _select_by: [u8; N],
    _select_values: [Field; N],
    _sort_by: [u8; N],
    _sort_order: [u2; N],
    _limit: u32,
    _offset: u32,
    _return_size: u32,
    _placeholder_fields: [Field; S]
