pub fn full_field_less_than(lhs: Field, rhs: Field) -> bool {
    dep::std::eddsa::lt_bytes32(lhs, rhs)
}

pub fn full_field_greater_than(lhs: Field, rhs: Field) -> bool {
    dep::std::eddsa::lt_bytes32(rhs, lhs)
}

